import { Box, Button, Divider, Paper, Stack, TextField, Typography } from '@mui/material';
import React from 'react'
import GenericComboBox from '../reusables/GenericComboBox';

function PersonaAE() {

    
    const stackHeaderStyle = {
        direction: "row",
        justifyContent: "space-between",
        sx: { my: 2 },
    };

    const inputsStackStyle = {
        sx: { width: "25%", minWidth: "200px", mr: 2 },
    };

    const newButtonStyle = {
        variant: "contained",
        size: "small",
        color: "success",
        sx: {},
    };

    const searchButtonStyle = {
        variant: "contained",
        size: "small",
        color: "primary",
        sx: {},
    };

  return (
    <>
     <Paper {...paperStyle}>
                <Box sx={{ p: 1 }}>
                    <Typography variant={"h5"}>Filtros</Typography>
                    <Divider />
                    <Stack
                        flexDirection={{ xs: "column", sm: "row" }}
                        sx={{ mt: 2 }}
                    >
                        <Stack {...inputsStackStyle}>
                            <Typography {...textLabel}>Nombre</Typography>
                            <TextField
                                value={nombre}
                                onChange={(event) => {
                                    setNombre(event.target.value);
                                }}
                            />
                        </Stack>
                        <Stack {...inputsStackStyle}>
                            <Typography {...textLabel}>
                                Tipo documento
                            </Typography>
                            <GenericComboBox
                                // label="Tipo de documento"
                                id="tipoDoc"
                                value={tipoDoc}
                                handleChange={(event) => {
                                    setTipoDoc(event.target.value);
                                }}
                                editable={true}
                                valueForNone="dfd"
                                labelForNone="Seleccionar tipo de documento"
                                values={["DNI", "Pasaporte", "L.E."]}
                                minWidth={200}
                            />
                        </Stack>
                    </Stack>
                    <Stack direction={"row"} justifyContent={"flex-end"}>
                        <Button {...searchButtonStyle}>
                            <Search />
                            Buscar
                        </Button>
                    </Stack>
                </Box>
            </Paper>
    </>
  )
}

export default PersonaAE
